function() {
    /***** START - publisher-start-header-language *****/
    // Called in list-suffix for each mode
    TRC.headersArray = ['Enlaces Patrocinados', 'Chamadas Patrocinadas', 'Sponsored Headlines']
    TRC.headerAssign = function(language) {
        try {
            var newHeader;
            switch(language) {
                case 'es':
                    newHeader = TRC.headersArray[0]
                    break
                case 'pt':
                    newHeader = TRC.headersArray[1]
                    break
                default:
                    newHeader = TRC.headersArray[2]
                    break
            }
            return newHeader
        } catch(e) {
            console.log('It is not working')
        }
    }
    /***** END - publisher-start-header-language *****/
    /***** Start - publisher-start-append-logo *****/
    TRC.appendLogo = function(box, data) {
        try {
            logoHolder = document.createElement('span');
            logoHolder.classList.add('logoHolder');
            logoHolder.classList.add('espnLogo');
            var thumbBlockHolder = box.querySelector('.thumbBlock_holder')
            var thumbBlock = box.querySelector('.thumbBlock')
            thumbBlock.appendChild(logoHolder)
        } catch (e) {
            __trcError('Error in publisher-start append-logo ' + e.message);
        }
    }
    /***** End - publisher-start-append-logo *****/
}
